pragma solidity ^0.8.13;

import "lib/openzeppelin-contracts/contracts/token/ERC20/IERC20.sol";

contract Exchange {
    string public name;

    constructor() {
        name = "exchange";
    }

    function swapExactTokensForTokens(
        uint256 amountIn,
        uint256 amountOutMin,
        address[] calldata path,
        address to,
        uint256 deadline
    ) external returns (uint256 amountOut) {
        IERC20(path[0]).transferFrom(msg.sender, address(this), amountIn);
        amountOut = getAmountOut(amountIn, amountOutMin, amountOutMin);
        IERC20(path[1]).transfer(msg.sender, amountOut);
    }

    function swapTokensForExactTokens(
        uint256 amountOut,
        uint256 amountInMax,
        address[] calldata path,
        address to,
        uint256 deadline
    ) external returns (uint256 amount) {
        IERC20(path[0]).transferFrom(msg.sender, address(this), amountInMax);
        amount = getAmountOut(amountInMax, amountOut, amountOut);
        IERC20(path[1]).transfer(msg.sender, amountOut);
    }

    function getAmountOut(
        uint256 amountIn,
        uint256 reserveIn,
        uint256 reserveOut
    ) public pure returns (uint256) {
        return (amountIn * 99) / 100;
    }
}
